import React from 'react';
import './input-panel.css';


const InputPanel = () => {

    const inputPanel = 'Write what you want ?';
    return(
        <div className = 'input-panel'>
            <div >
                <input placeholder = {inputPanel}></input>
            </div>
            <button>ADD NEW</button>
        </div>
    )
};

export default InputPanel;
